  return (
    <>
    <WeatherDiv>
      <h1>Lancaster, PA</h1>
      <h2>{props.weather.LocalObservationDateTime}</h2>
      <p>{console.log((props.temperature[0]))}</p>
      <p>{props.weather.WeatherIcon}</p>
      <p>{props.weather.WeatherText}</p>
      <p>fhafh</p>
      <p>huminity</p>
    </WeatherDiv>
    </>
  );
}

export default Api;
